create table items_types
(
    Id                    int          not null
        primary key,
    Name                  varchar(255) null,
    NameId                int unsigned not null,
    SuperTypeId           int unsigned not null,
    Plural                tinyint      not null,
    Gender                int unsigned not null,
    ZoneMinSize           int unsigned not null,
    ZoneSize              int unsigned not null,
    ZoneEfficiencyPercent int unsigned not null,
    ZoneMaxEfficiency     int unsigned not null,
    ZoneShape             int          not null,
    Mimickable            tinyint      not null,
    CraftXpRatio          int          not null
)
    engine = MyISAM
    charset = utf8;

